import createLucideIcon from '../createLucideIcon';

const Pill = createLucideIcon('Pill', [
  [
    'path',
    {
      d: 'm10.5 20.5 10-10a4.95 4.95 0 1 0-7-7l-10 10a4.95 4.95 0 1 0 7 7Z',
      key: 'wa1lgi',
    },
  ],
  ['path', { d: 'm8.5 8.5 7 7', key: 'rvfmvr' }],
]);

export default Pill;
